using System.Text.RegularExpressions;

public class Difference
{
    private char FindTheDifference(string s, string t)
    {
        Dictionary<char, int> record = new Dictionary<char, int>();
        char ans = '-';
        foreach(char ch in s)
            if(record.ContainsKey(ch))
                record[ch]++;
            else
                record.Add(ch, 1);

        foreach (char ch in t) {
            if(!record.ContainsKey(ch))
                return ch;
            else if(record[ch] == 0)
                return ch;
            record[ch]--;
        }
        return ans;
    }

    public void Test()
    {
        string s = "";
        string t = "";

        System.Console.WriteLine(FindTheDifference(s, t));
    }
}